import React, { Component } from 'react';

export default class Chef extends Component {

    render(){
        const { profileUrl, name, title, comment, url } = this.props;
        return (

            <div className='chef-container flex-container-col'>
                <div className="flex-container-row flex-item-col">
                    <div className="flex-item-row align">
                        <img className="profile-pic" src={profileUrl} alt={name}/>
                    </div>
                    <div className="flex-container-col flex-item-row align">
                        <h2 className="list-title">{name}</h2>
                        <h3 className="list-subtitle">{title}</h3>
                    </div>

                </div>
                <div className="comment-container flex-item-col">
                    <h2 className="h2">
                        {comment}
                    </h2>

                </div>
                <div className="pic-container flex-item-col">
                    <img src={url} alt={comment}/>
                </div>
            </div>
        );
    }
}
